  true,\n\t\"url\": null,\n\t\"notes\": \"The Program Access Index (PAI) is one of
  the measures the USDA Food and Nutrition Service (FNS) uses to reward States for
  high performance in the administration of the Supplemental Nutrition Assistance
  Program (SNAP). The Farm Security and Rural Investment Act of 2002 (also known as
  the 2002 Farm Bill) directed USDA to establish a number of indicators of effective
  program performance and to award bonus payments to States with the best and most
  improved performance. The PAI is designed to indicate the degree to which low-income
  people have access to SNAP benefits.\",\n\t\"license_title\": \"Creative Commons
